import React from 'react';
import './Nav.css'
import {Link} from 'react-router-dom';

function Nav() {
  return (
    <div className="Nav">
      <nav>
          <h3>logo</h3>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/users">Users</Link>
            </li>
          </ul>
      </nav>
    </div>
  );
}

export default Nav;
